import React, {Component} from "react"
import "./Kontact.css"
import {translate} from "react-switch-lang";
import {Container, Row, Col, InputGroup, Form, FormControl} from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';

class Kontact extends Component {
    state = {
        id:"0"
    }
    render() {
        const {t} = this.props;
        return (
            <Container fluid={true} className={"kontact"} id={this.props.id}>
                <div className={"pt-3"}>
                    <h1 className="text-center">{t('header.section6.title')}</h1>
                </div>
                    <Row className="p-3 row_brown">
                        <Col sm={7}>
                            <Form>
                                <Form.Group className={"mb-3"}controlId="formBasicEmail">

                                    <Form.Control className={"mb-3"} type="text" placeholder="Imię" />
                                    <Form.Control className={"mb-3"} type="email" placeholder="Enter email" />
                                    <Form.Control className={"mb-3"} type="text" placeholder="Telefon" />
                                    <Form.Control as="textarea" rows="3" placeholder="Treść" />
                                </Form.Group>
                            </Form>

                        </Col>
                        <Col sm={5}>

                        </Col>
                    </Row>

            </Container>
        )
    }
}
export default translate(Kontact)
